<html xmlns:wicket="http://wicket.apache.org">
<head>
<meta charset="utf-8" />
<title>Manteniket</title>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
</head>
<body>
	<wicket:extend>
	<form wicket:id="form">
		<button wicket:id="btnAdd"></button>
		
		<button wicket:id="btnReturn"></button>
	</form>
		<table class="table">
			<tr>
				<th><wicket:message key="head.bike"/></th>
				<th><wicket:message key="head.component"/></th>
				<th><wicket:message key="head.init"/></th>
				<th><wicket:message key="head.finish"/></th>
				<th colspan="3"><wicket:message key="head.actions" /></th>
			</tr>
			<tr wicket:id="rows">
				<td wicket:id="dataRow"></td>
			</tr>
		</table>
		<ul wicket:id="pagingNavigator">
			<li>1</li>
			<li>2</li>
			<li>3</li>
		</ul>
	</wicket:extend>
</body>
</html>
